.progressSpinner {
  z-index: 100;
  background-image: url("$a");
  background-repeat: no-repeat;
  background-size: contain;  /* This makes the image fit inside the element without stretching */
  background-position: center;  /* This centers the image within the element */
  height: 100px;
  width: 100px;
  animation: heartbeat 1s infinite;
}

@keyframes heartbeat {
  0% {
    transform: scale(1);
  }
  14% {
    transform: scale(1.1);
  }
  28% {
    transform: scale(1);
  }
  42% {
    transform: scale(1.1);
  }
  70% {
    transform: scale(1);
  }
}


